import React, { useState } from 'react';
import { View, Text, StyleSheet, TextInput, TouchableOpacity, Animated } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import FastFoodBox from './FastFoodBox'; // Ensure correct relative path
import SDashboard from './SDashboard'; // Ensure correct relative path

export default function MainDashboard() {
  const [editableText, setEditableText] = useState("Fast Food Box");
  const [scaleValue] = useState(new Animated.Value(1));
  const [isEditing, setIsEditing] = useState(false);

  const handlePlusButtonPress = () => {
    setIsEditing(!isEditing);
  };

  return (
    <View style={styles.container}>
      <FastFoodBox
        scaleValue={scaleValue}
        isEditing={isEditing}
        handlePlusButtonPress={handlePlusButtonPress}
        editableText={editableText}
        setEditableText={setEditableText}
      />
      <SDashboard editableText={editableText} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});
